import React from "react"
import "./Modal.scss"




const Modal: React.FC = () => {



    return(
        <div className="container_modal">
            <h1>New Game</h1>
            <div className="btn_modal" ><h1>GO!</h1></div>
        </div>
    )
}

export default Modal;
